import React from "react";
import { TextField, GridList, GridListTile } from "@material-ui/core";

const HomePage = () => {
	return (
		<>
			<h1>Home Page</h1>
			<form>
				<TextField placeholder="Search recipes" variant="outlined" />
				<GridList>
					<GridListTile cols={4}>Recipes</GridListTile>
				</GridList>
			</form>
		</>
	);
};

export default HomePage;
